import './Icon.css';

// Icon View COmponent
export default function ReturnIcon(props) {
 return (
  <div className='icon-nav-view'>
   <span>
    <img src={props.IMA} alt='nav icon' />
   </span>
   <p>{props.Text}</p>
  </div>
 );
}
